package dev.alsabea.controllers.utilities;

public class Ids {

	
	long empId ;
	long mgrId ;
	long rrId ;
	
	public Ids() {
		super();
		// TODO Auto-generated constructor stub
	}

	public long getEmpId() {
		return empId;
	}

	public void setEmpId(long empId) {
		this.empId = empId;
	}

	public long getMgrId() {
		return mgrId;
	}

	public void setMgrId(long mgrId) {
		this.mgrId = mgrId;
	}

	public long getRrId() {
		return rrId;
	}

	public void setRrId(long rrId) {
		this.rrId = rrId;
	}

	
}
